import React from 'react';
import '../styles/main.css';



function ListCard({ items }) {


  return (
    <div className="list-card">
      {items.map(item => (
        <div className="list-card-item">
          <h2 className="list-card-title">{item.name}</h2>
        </div>
      ))}
    </div>
  );
}

export default ListCard;
